import React from "react";
import PropTypes from "prop-types";
import Layout from "components/Layout/Layout";

const Index = ({ t }) => {
	return <Layout>Index page created.</Layout>;
};
Index.props = {
	namespacesRequired: ["common"]
};

export default Index;
